import { Book } from "react-bootstrap-icons";

export function SearchResults({ results, updateBook, shelves }) {
    return (
        <div>
            <div className="search-books-results">
                <ol className="books-grid">
                { results
                    ? results.map((book) => {
                        return (
                            <Book 
                                key={book.title} 
                                book={book}
                                updateBook={updateBook}
                                shelves={shelves}
                            />)
                        })
                    : `No results`
                    }
                </ol>
            </div>
        </div>
    )
}
